INSERT INTO `animes` (`id`, `code`, `name`, `short_name`, `image`, `thumb_image`, `thumb_image_2`, `description`, `episode_count`, `season_count`, `average_min`, `date`, `main_category`, `main_category_name`, `click_count`, `comment_count`, `scoreUsers`, `score`, `showStatus`, `plusEighteen`, `create_user_code`, `update_user_code`, `deleted`, `created_at`, `updated_at`) VALUES
(1, 1, 'Solo Leveling', 'solo-leveling', 'files/animes/animesImages/1.png', 'files/animes/animesImages/thumbnails/1_thumbnail.png', 'files/animes/animesImages/thumbnails/1_thumbnail_2.png', 'On yıl önce \'\'Kapı\'\' ortaya çıktı ve gerçek dünya ile büyü ve canavarlar alemini birbirine bağladı. Bu iğrenç yaratıklarla savaşmak için sıradan insanlar insanüstü güçlere sahip oldular ve \'\'Avcı\'\' olarak tanındılar. Yirmi yaşındaki Sung Jin-Woo da böyle bir Avcıdır, ancak E-Rank\'a kıyasla bile acınası gücü nedeniyle \'\'Dünyanın En Zayıfı\'\' olarak bilinmektedir. Yine de annesinin hastane masraflarını karşılamak için düşük rütbeli Gates\'te yorulmadan canavar avlamaktadır. Ancak bu sefil yaşam tarzı, Jin-Woo\'nun -korkunç bir şekilde yanlış giden bir görevde ölecek tek kişinin kendisi olduğuna inanarak- üç gün sonra bir hastanede uyandığında önünde yüzen gizemli bir ekran bulmasıyla değişir. Bu \'\'Görev Günlüğü\'\' Jin-Woo\'nun gerçekçi olmayan ve yoğun bir eğitim programını tamamlamasını ya da uygun bir cezaya çarptırılmasını talep etmektedir. Görevin zorluğundan dolayı başlangıçta buna uymakta isteksiz olan Jin-Woo, çok geçmeden bunun kendisini dünyanın en korkunç Avcılarından birine dönüştürebileceğini fark eder.', 0, 0, 22, '2024', 3, 'Doğa üstü', 7, 0, 0, 0.00, 0, 0, 0, 0, 0, '2024-02-25 16:13:05', '2024-04-11 06:22:24');
