INSERT INTO `pages` (`id`, `code`, `name`, `short_name`, `text`, `description`, `create_user_code`, `update_user_code`, `deleted`, `created_at`, `updated_at`) VALUES
(1, 1, 'Hakkımızda', 'Hakkımızda', '<p>&nbsp;Merhabalar, AniKagai olarak size Anime ve Webtoon hizmeti veriyoruz.</p><p>Bu hizmetler sırasında depoladığımız tek bilginiz mail adresleriniz içiniz rahat olsun.</p><p>Amacımız sizlere en kaliteli içerikleri en hızlı şekilde ulaştırabilmek.</p><p>Sitemizde gördüğünüz sorunları veya düzeltilmesi gereken kısımları bize iletişim kısmından iletebilirsiniz.</p><p>Ekibimize Editör ya da Çevirmen olarak katılmak istiyorsanız bize discord adresimizden yada sitemizin iletişim Kısımından ulaşabilirsiniz.</p><p style=\"\">Reklam, telif hakları, soru ve öneriler ile ilgili konularda \"https://anikagai.com/contact\" adresinden bizimle irtibat kurabilirsiniz.</p><p style=\"\">AniKagai 5651 sayılı yasanın 5. maddesinde tanımlanan yer sağlayıcı olarak hizmet vermektedir. İlgili yasaya göre, web site yönetiminin hukuka aykırı içerikleri kontrol etme yükümlülüğü yoktur. Bu sebeple, sitemiz uyar ve kaldır prensibini benimsemiştir. Telif hakkına konu olan eserlerin yasal olmayan bir biçimde paylaşıldığını ve yasal haklarının çiğnendiğini düşünen hak sahipleri veya meslek birlikleri, \"https://anikagai.com/contact\" mail adresinden bize ulaşabilirler. Buraya ulaşan talep ve şikayetler hukuksal olarak incelenecek, şikayet yerinde görüldüğü takdirde, ihlal olduğu düşünülen içerikler sitemizden kaldırılacaktır.</p><p style=\"\">İlgili Yasa:</p><p style=\"\">MADDE 5-(1) Yer sağlayıcı, yer sağladığı içeriği kontrol etmek veya hukuka aykırı bir faaliyetin söz konusu olup olmadığını araştırmakla yükümlü değildir.</p><p style=\"\">(2) Yer sağlayıcı, yer sağladığı hukuka aykırı içerikten, ceza sorumluluğu ile ilgili hükümler saklı kalmak kaydıyla, bu Kanunun 8 inci ve 9 uncu maddelerine göre haberdar edilmesi halinde ve teknik olarak imkân bulunduğu öl­çü­de hu­ku­ka aykırı içeriği yayından kaldırmakla yükümlüdür.</p><p style=\"\">English translation:</p>For productions whose copyright belongs to you, the relevant production will be removed from our site within 5 business days as long as you notify us from the \"https://anikagai.com/contact\" section.<br><div class=\"row\" style=\"box-sizing: border-box; display: flex; flex-wrap: wrap; margin-right: -12px; margin-left: -12px; font-family: Rubik, sans-serif; font-size: 13.6px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><div class=\"col-md-12 mb-3\" style=\"box-sizing: border-box; position: relative; width: 1587px; padding-right: 12px; padding-left: 12px; -webkit-box-flex: 0; flex: 0 0 100%; max-width: 100%; margin-bottom: 1rem !important;\"><div class=\"note-editor note-frame card\" style=\"box-sizing: border-box; position: relative; display: flex; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: column; min-width: 0px; overflow-wrap: break-word; background-clip: border-box; border: 1px solid rgb(169, 169, 169); border-radius: 0.25rem; margin: 0px; box-shadow: none;\"><div class=\"note-statusbar\" role=\"status\" style=\"box-sizing: border-box; background-color: rgb(245, 245, 245); border-top: 1px solid rgb(221, 221, 221); border-bottom-left-radius: 4px; border-bottom-right-radius: 4px;\"><br class=\"Apple-interchange-newline\"></div></div></div></div><p style=\"color: rgb(255, 255, 255); font-family: &quot;proxima nova gremots&quot;, &quot;helvetica neue&quot;, sans-serif; font-size: 14px;\"><br>Açıklama:</p><div class=\"row\" style=\"box-sizing: border-box; display: flex; flex-wrap: wrap; margin-right: -12px; margin-left: -12px; color: rgb(80, 93, 105); font-family: Rubik, sans-serif; font-size: 13.6px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-