(2, 2, 'Hakkımızda', 'Hakkımızda', '<p style=\"font-size: 13.6px;\">&nbsp;Merhabalar, AniKagai olarak size Anime ve Webtoon hizmeti veriyoruz.</p><p style=\"font-size: 13.6px;\">Bu hizmetler sırasında depoladığımız tek bilginiz mail adresleriniz içiniz rahat olsun.</p><p style=\"font-size: 13.6px;\">Amacımız sizlere en kaliteli içerikleri en hızlı şekilde ulaştırabilmek.</p><p style=\"font-size: 13.6px;\">Sitemizde gördüğünüz sorunları veya düzeltilmesi gereken kısımları bize iletişim kısmından iletebilirsiniz.</p><p style=\"font-size: 13.6px;\">Ekibimize Editör ya da Çevirmen olarak katılmak istiyorsanız bize discord adresimizden yada sitemizin iletişim Kısımından ulaşabilirsiniz.</p><p style=\"font-size: 13.6px;\">Reklam, telif hakları, soru ve öneriler ile ilgili konularda \"https://anikagai.com/contact\" adresinden bizimle irtibat kurabilirsiniz.</p><p style=\"font-size: 13.6px;\">AniKagai 5651 sayılı yasanın 5. maddesinde tanımlanan yer sağlayıcı olarak hizmet vermektedir. İlgili yasaya göre, web site yönetiminin hukuka aykırı içerikleri kontrol etme yükümlülüğü yoktur. Bu sebeple, sitemiz uyar ve kaldır prensibini benimsemiştir. Telif hakkına konu olan eserlerin yasal olmayan bir biçimde paylaşıldığını ve yasal haklarının çiğnendiğini düşünen hak sahipleri veya meslek birlikleri, \"https://anikagai.com/contact\" adresinden bize ulaşabilirler. Buraya ulaşan talep ve şikayetler hukuksal olarak incelenecek, şikayet yerinde görüldüğü takdirde, ihlal olduğu düşünülen içerikler sitemizden kaldırılacaktır.</p><p style=\"font-size: 13.6px;\">İlgili Yasa:</p><p style=\"font-size: 13.6px;\">MADDE 5-(1) Yer sağlayıcı, yer sağladığı içeriği kontrol etmek veya hukuka aykırı bir faaliyetin söz konusu olup olmadığını araştırmakla yükümlü değildir.</p><p style=\"font-size: 13.6px;\">(2) Yer sağlayıcı, yer sağladığı hukuka aykırı içerikten, ceza sorumluluğu ile ilgili hükümler saklı kalmak kaydıyla, bu Kanunun 8 inci ve 9 uncu maddelerine göre haberdar edilmesi halinde ve teknik olarak imkân bulunduğu öl­çü­de hu­ku­ka aykırı içeriği yayından kaldırmakla yükümlüdür.</p><p style=\"font-size: 13.6px;\">English translation:</p><p><span style=\"font-size: 13.6px;\">For productions whose copyright belongs to you, the relevant production will be removed from our site within 5 business days as long as you notify us from the \"https://anikagai.com/contact\" section.</span><br></p>', NULL, 1, 1, 0, '2023-12-30 17:19:37', '2023-12-31 20:30:12'),
