INSERT INTO `webtoons` (`id`, `code`, `name`, `short_name`, `image`, `thumb_image`, `thumb_image_2`, `description`, `episode_count`, `season_count`, `average_min`, `main_category`, `main_category_name`, `date`, `click_count`, `comment_count`, `scoreUsers`, `score`, `showStatus`, `plusEighteen`, `create_user_code`, `update_user_code`, `deleted`, `created_at`, `updated_at`) VALUES
(2, 2, 'The S-Classes That I Raised', 'the-s-classes-that-i-raised', 'files/webtoons/webtoonImages/1.jpg', 'files/webtoons/webtoonImages/thumbnails/1_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/1_thumbnail_2.jpg', '-Yetiştirdiğim S Sınıflar-   F-Sınıf bir Avcı, aslında daha çok S-Sınıf avcı kardeşine sırtını dayamış sefil bir avcı diyelim.\r\nBok gibi hayatı yarım yamalak yaşamanın eşiğinden dönerken kardeşime bakınca bana verilen unvan\r\n“Mükemmel Bakıcı”ydı. Tamam be, o zaman bu sefer kenardan onları izlerken fukara hayatı sürdüreceğim.\r\nGerçi ben öyle hayal etmiştim ancak şu\r\nS-Seviyeler… Bir garipler.', 6, 1, 0, 12, 'Sistem', '2023', 301, 5, 5, 4.70, 0, 0, 0, 0, 0, '2024-02-25 16:14:02', '2024-04-21 09:55:58'),
(3, 3, 'Legend Of The Northern Blade', 'legend-of-the-northern-blade', 'files/webtoons/webtoonImages/2.jpg', 'files/webtoons/webtoonImages/thumbnails/2_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/2_thumbnail_2.jpg', 'Dünya “Sessiz Gece” tarafından karanlığa büründüğünde, tüm dövüş sanatçıları toplanarak “Kuzey Gökçe Mezhebi‘ni” oluşturdu. Kuzey Gökçe Mezhebi‘nin ezici gücü sayesinde Sessiz Gece püskürtüldü ve dünya bir kez daha huzur ve barış dönemine geçti. Fakat zaman geçtikçe Ana Karadaki dövüş sanatçıları Kuzey Gökçe Mezhebi‘ne komplo kurup, Dördüncü Nesil Mezhep Lideri Jin Kwan-Ho‘nun ölümüyle mezhebe bir son getirdi. Jin Kwan-Ho‘nun bir ve yegane oğlu Jin Mu-Won aileden geriye kalan tek kişiydi. Mu-won dövüş sanatları hakkında hayatı boyunca bir şey öğrenmemiş çocuğun teki olsa da babasının gizlice arkasında bıraktığı dövüş sanatları tekniklerini bularak Kuzey Gökçe Mezhebi‘ni elde etmek için yolculuğuna başladı…!.', 24, 1, 0, 4, 'Murim', '2022', 611, 0, 5, 4.90, 0, 0, 0, 0, 0, '2024-02-25 16:14:49', '2024-04-20 21:48:03'),
(4, 4, 'Rooftop Sword Master', 'rooftop-sword-master', 'files/webtoons/webtoonImages/3.png', 'files/webtoons/webtoonImages/thumbnails/3_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/3_thumbnail_2.png', '-Çatı Katı Kılıç Ustası-   Num’Gwang Ortaokulu’ndaki 8 sınıf arkadaşı tarafından ölesiye dayak yiyip komaya düştükten sonra Se’young 9 uzun ayın ardından uyanır ve babası, evladı adına adaleti aramak için kendini kurban ederek intihar ettiğini öğrenir.Sonuç olarak suçlarını ört pas etmeye çalışan saldıranlara inceleme tekrar açılır ve layığıyla cezalandırılırlar, ama Se’young içinde yanan dünyanın adaletsizliğine karşı olan öfkesini bastıramaz, ve kendini böyle bir dünyadan soyutlamaya çalışır.Güneş doğar ve batar, mevsimler gelir ve geçer, ve evinden bir adım bile dışarıya adımını atmaz. Ama bir gün birden bire tuhaf bir ses duyar ve kapıyı açtığında-Çatısının ortasına saplanmış halde duran ve üzerinde “Savaş Kılıcı” kelimeleri kazınmış muazzam büyük bir kılıçla karşılaşır.', 12, 1, 0, 3, 'Doğa üstü', '2022', 443, 2, 5, 4.50, 0, 0, 0, 0, 0, '2024-02-25 16:16:31', '2024-04-20 20:22:41'),
(5, 5, 'Demonic Evolution', 'demonic-evolution', 'files/webtoons/webtoonImages/4.webp', 'files/webtoons/webtoonImages/thumbnails/4_thumbnail.webp', 'files/webtoons/webtoonImages/thumbnails/4_thumbnail_2.webp', 'Demonic Evolution\r\nÖlümün eşiğinde, insanlığın en güçlü savaşçısı Ang, iki ucu keskin tehlikeli bir kılıç olan “En Güçlü İblis”in gücüyle altmış yıl sonra gizemli bir şekilde reenkarne olur. Pişmanlıklarını gidermek ve gerçeği ortaya çıkarmak için Ang’in geçmiş kaderinden kaçmak için sürekli “gelişmekten” başka seçeneği yoktur. “Şişelenmiş bir iblis olmama izin vermeyeceğim! Eğer çıkmak istiyorsam, kendime güvenmeliyim!”', 11, 1, 0, 3, 'Doğa üstü', '2023', 525, 2, 4, 4.12, 0, 0, 0, 0, 0, '2024-02-25 16:17:25', '2024-04-20 20:22:40'),
(6, 6, 'Boss Returns', 'boss-returns', 'files/webtoons/webtoonImages/5.jpg', 'files/webtoons/webtoonImages/thumbnails/5_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/5_thumbnail_2.jpg', '-Patronun Dönüşü-\r\n\r\nYani, Patron Geri Döndü!\r\n\r\nÜlke çapında bir çetenin patronu olan \'Baek GangHoon\' kendi adamlarından biri tarafından sırtından bıçaklandıktan sonra kendini lise günlerine gerilemiş halde bulur! Karısının ölümünün tekrarlanmasını önlemek için şiddet içermeyen yeni bir hayata başlayabilecek mi?', 8, 1, 0, 13, 'Zamanda Yolculuk', '2023', 1455, 59, 6, 4.00, 0, 0, 0, 1, 0, '2024-02-25 16:18:01', '2024-04-21 14:38:03'),
(7, 7, 'Moby Dick', 'moby-dick', 'files/webtoons/webtoonImages/6.jpg', 'files/webtoons/webtoonImages/thumbnails/6_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/6_thumbnail_2.jpg', 'Bir gün, beş parasız Hoonsang şüpheli bir kartvizit alır ve bu kartvizit ona hile şehri Bannam-dong adlı yeni bir şehirde yeni bir hayat ve bir ton para kazandırır. \"VIP\'ler için bir \'hediye\' olacaksın. Onlara asla unutamayacakları bir zevk ver.\"', 6, 1, 0, 26, 'Günlük Hayat', '2023', 237, 7, 8, 4.19, 1, 1, 0, 0, 0, '2024-02-25 16:18:48', '2024-04-15 14:14:07'),
(8, 8, 'Rental Hero', 'rental-hero', 'files/webtoons/webtoonImages/7.jpg', 'files/webtoons/webtoonImages/thumbnails/7_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/7_thumbnail_2.jpg', 'Lee JooWon, kahramanlar dünyayı kurtarırken onların yerini alarak onlar için medyada görünen bir düblördür. Dünyanın bir numaralı kahramanı olan Justice, Lee JooWon’a kendisinin dublörlüğünü yapması için bir iş teklifiyle gelir. Lee JooWon, Justice’in teklifini yüksek bir ücret karlışığında kabul ettikten sonra kararlaştırılan yere gider ve hiç beklemediği bir şey görür…', 6, 1, 0, 25, 'Süper Güçler', '2023', 290, 0, 2, 4.50, 0, 0, 0, 0, 0, '2024-02-25 16:19:26', '2024-04-20 17:49:43'),
(9, 9, 'The Boxer', 'the-boxer', 'files/webtoons/webtoonImages/8.jpg', 'files/webtoons/webtoonImages/thumbnails/8_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/8_thumbnail_2.jpg', 'Rakipsiz hayal edilemez bir yetenek, kendini bir kutsama mı, yoksa lanet olarak mı kanıtlayacak?', 27, 1, 0, 9, 'Dövüş Sanatları', '2022', 712, 1, 3, 4.50, 0, 0, 0, 6, 0, '2024-02-25 16:20:04', '2024-04-21 05:13:49'),
(10, 10, 'The Hole Is Open', 'the-hole-is-open', 'files/webtoons/webtoonImages/9.JPG', 'files/webtoons/webtoonImages/thumbnails/9_thumbnail.JPG', 'files/webtoons/webtoonImages/thumbnails/9_thumbnail_2.JPG', 'JA-KANG\'a büyükbabasının dükkânı miras kalmıştır. Dükkanda gizli bir oda ve gizli bir \"delik\" vardır!', 5, 1, 0, 26, 'Günlük Hayat', '2023', 223, 15, 3, 5.00, 1, 1, 0, 0, 0, '2024-02-25 16:20:39', '2024-04-19 08:18:52'),
(11, 11, 'Killer Pedro', 'killer-pedro', 'files/webtoons/webtoonImages/11png', 'files/webtoons/webtoonImages/thumbnails/11_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/11_thumbnail_2.png', '-Killer Piedro-   İntikam almak isteyen Yaşlı bir katil bir anda gençleşir!\r\n\r\n-Fakat… Kimse beni tanımıyor mu?\r\n\r\n“Öyleyse en güçlüsü benim!”', 5, 1, 0, 3, 'Doğa üstü', '2023', 291, 0, 0, 4.75, 0, 0, 0, 1, 0, '2024-02-25 16:21:13', '2024-04-20 17:49:44'),
(12, 12, 'I Am The Strongest Boss', 'i-am-the-strongest-boss', 'files/webtoons/webtoonImages/11.jpg', 'files/webtoons/webtoonImages/thumbnails/11_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/11_thumbnail_2.jpg', 'Sayısız kahraman, hikayenin başkahramanı olduklarını düşünerek hayatlarını tehlikeye atar, ancak yalnızca seçilmiş kişi başkahramanın olay örgüsü zırhına sahiptir. Kahraman, olay örgüsü zırhını kaybettiğinde artık kahraman değildir.', 9, 1, 0, 25, 'Süper Güçler', '2024', 406, 1, 3, 4.33, 0, 0, 0, 0, 0, '2024-02-25 16:21:58', '2024-04-21 03:24:17'),
(14, 14, 'Hell Fists', 'hell-fists', 'files/webtoons/webtoonImages/12.png', 'files/webtoons/webtoonImages/thumbnails/12_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/12_thumbnail_2.png', '-Cehennem Yumrukları-   Şunu hayal edin: İnsan aleminin koruyucususunuz, Yarı Şeytan Yarı Melek. Doğaüstü güçlerin parayla çalışıyor, sihirle değil. Sorun ne? Beş parasızsın çünkü insanlar bugünlerde yeraltı dünyası yaratıklarını işe almıyor! Ayrıca, bakman gereken iki ev hanımın var. Sitcom gibi, sadece daha fazla göksel savaş var!! Bunun şimdiye kadarki en çılgın çizgi roman konusu olduğunu düşünüyorsanız, çok şaşıracaksınız!', 3, 1, 0, 3, 'Doğa üstü', '2023', 211, 5, 1, 5.00, 0, 0, 0, 0, 0, '2024-02-25 16:23:22', '2024-04-21 03:42:40'),
(15, 15, 'Solo Leveling', 'solo-leveling', 'files/webtoons/webtoonImages/13.png', 'files/webtoons/webtoonImages/thumbnails/13_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/13_thumbnail_2.png', 'Solo Leveling\r\n10 yıl önce, dünyamızı canavar dünyasına bağlayan “Geçit” açıldığında sıradan, normal insanlar,Geçitten canavar avlayabildikleri güçler kazandılar ve “Avcılar” olarak tanındılar. Ancak, tüm Avcılar sanıldığı kadar güçlü değildi. Benim adım Sung Jin-Woo, bie E-Sınıfı Avcıyım. Hayatını en düşük zindanlarda heba etmesi gereken “Dünyanın En Zayıfı”yım. Kendimi kanıtlayabildiğim bir yeteneğim olmadığı için düşük seviye zindanlarda zor da olsa para kazanabildim… Ta ki D-Sınıfı zindanların arasında gizli bir zindan bulana kadar! Tam da sona vardığımı düşünmüşken garip bir güç edindim, sadece benim görebildiğim bir görev kaydı, sadece benim bildiğim bir seviye atlama yolu!Görevlerime uyarak kendimi geliştirir ve canavar avlarsam seviyem yükselecek. En zayıf Avcıdan S-Sınıfı Avcıya yükselişim! Solo Leveling', 6, 1, 0, 12, 'Sistem', '2022', 387, 5, 2, 5.00, 0, 0, 0, 0, 0, '2024-02-25 16:26:25', '2024-04-21 05:13:54'),
(16, 16, 'An Animal Hospital In The Border Area', 'an-animal-hospital-in-the-border-area', 'files/webtoons/webtoonImages/14.jpg', 'files/webtoons/webtoonImages/thumbnails/14_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/14_thumbnail_2.jpg', '-Sınır Bölgesindeki Hayvan Hastanesi-   Kim A-young, kredilerle boğuşan hayvan hastanesi müdürü. Bir gün bir telefon alır. \"Orada bir sürüngen görüyor musun?\" Sürüngen terapisi yapıyorum ama bu benim uzmanlık alanım değil. tedavi için bir sürüngen, değil mi? Mavi bir ejderha doktoru görmeye gelmiş! Ahyoung Hayvan Hastanesi, baygınlık geçirdikten sonra onu tedavi ettiğinde kulaktan kulağa yayıldı. Yeni hastalar sıraya giriyor. Akıl almaz bir kimliğe bürünmüş hayvanlara bakan Ah-yeong, cömert tıbbi masrafları için kısa bir süre düşündü. \"Canavar mı? Mavi Ejderha mı? Bilmiyorum! Para en iyisidir!\" Veterinerin yeni tıbbi cihazı. Ahyoung özel hastaları güvenle tedavi edebilecek ve huzurlu bir günlük hayata dönebilecek mi?', 3, 1, 0, 2, 'Bilim Kurgu', '2023', 154, 0, 0, 0.00, 0, 0, 0, 0, 0, '2024-02-25 16:28:01', '2024-04-20 02:15:27'),
(18, 18, 'Brother, Am I Cute?', 'brother--am-i-cute-', 'files/webtoons/webtoonImages/15.jpg', 'files/webtoons/webtoonImages/thumbnails/15_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/15_thumbnail_2.jpg', '-Abi Ben Tatlı mıyım?-   Si-hyuk anne ve babasını ani bir trafik kazasında kaybeder ve küçük kardeşi Si-ha ondan 20 yaş küçüktür.\r\n\r\nAile cenazede benim ve küçük kardeşimin hakkında fısıldaşıyordu.\r\n\r\n\"Bu ikisiyle ne yapmalı? Kim sorumluluk almak ister?\"\r\n\"Aman Tanrım. \"Artık üniversite öğrencisi olduğuna göre, küçük kardeşini nasıl yetiştirecek?\"\r\n\"Sigorta parası olduğunu duydum.\"\r\n\r\nBu karmaşanın ortasında Siha ağzını açtı.\r\n\r\n\"Abi. Abi. \"Uwaa!\"\r\n\r\nSiha ilk kez kelimeleri doğru telaffuz eder ve ağlar.\r\n\r\nAbi.\r\nKardeşim dedi, babam ya da annem değil.\r\nSi-hyuk yavaşça yaklaştı ve Siha\'ya sarıldı.\r\nSeni koruyacağım.', 1, 1, 0, 15, 'Dram', '2023', 245, 3, 0, 0.00, 0, 0, 0, 0, 0, '2024-02-25 16:28:43', '2024-04-21 14:44:04'),
(19, 19, 'You Go And Marry With My Husband', 'you-go-and-marry-with-my-husband', 'files/webtoons/webtoonImages/16.jpg', 'files/webtoons/webtoonImages/thumbnails/16_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/16_thumbnail_2.jpg', '-Kocamla Evlen-   “Lütfen bana biraz izin ver, tamam mı? Yaşayan insanların hayatına devam etmesi gerekir. Nasıl olsa öleceksin.….” Önümde, tek arkadaşım sandığım kişi timsah gözyaşları döküyordu ve yaşam için zamanım bile dolmadan kocamın ellerinde öldüm. Ve “Jiwon, yemek saati bitti!” On yıl önce, şirketimden uyandım. Ölümden sonra verilen başka bir hayat. Kaderi değiştirmek için onun yerine birinin kaderime üstlenmesi gerekiyor. Arkadaşım olarak ‘birini’ seçtim. Kocamı istedin ve bende sana veriyorum.', 2, 1, 0, 6, 'Romantizm', '2023', 116, 0, 0, 0.00, 0, 0, 0, 0, 0, '2024-02-25 23:42:35', '2024-04-20 04:03:24'),
(20, 20, 'Death Is the Only Ending for the Villainess', 'death-is-the-only-ending-for-the-villainess', 'files/webtoons/webtoonImages/17.jpg', 'files/webtoons/webtoonImages/thumbnails/17_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/17_thumbnail_2.jpg', '-Caninin Tek Sonu Ölüm-   \r\nPenelope Eckart; Dük Eckart‘ın evlatlık kızı ve harem partner simülatörünün kötü karakteri olarak reenkarne oldum. Sorun şu ki, oyuna en zor seviyede girdi ve ne yaparsa yapsın, her seferinde ölümle burun buruna geliyor! Dük Eckart‘ın gerçek kızı ortaya çıkmadan önce, erkek ana karakterlerden birini seçmeli ve hayatta kalmak için mutlu bir sona ulaşmalıdır. Ama bu iki kardeş onunla her zaman, en ufak bir şeyde bile kavgaya tutuşuyor. Bununla birlikte rotaları ölüme yol açan çılgın bir veliaht prens, dişi kurşunla büyülenmiş bir sihirbaz ve sadık bir köle şövalyesi bile var! Ama nasıl oluyorsa, ne zaman çizgiyi aşsa ana karakterler ile olan aşk ölçeri yükseklik gösteriyor! İşte bu çılgın bir harem simülasyonunun içinde tıkalı kalmış Penelope‘un hikayesi. Death Is the Only Ending for the Villainess', 2, 1, 0, 7, 'Sihir', '2023', 141, 0, 0, 0.00, 0, 0, 0, 0, 0, '2024-02-25 23:43:59', '2024-04-20 15:15:42'),
(21, 21, 'I’ll Be The Matriarch In This Life', 'i-ll-be-the-matriarch-in-this-life', 'files/webtoons/webtoonImages/18.jpg', 'files/webtoons/webtoonImages/thumbnails/18_thumbnail.jpg', 'files/webtoons/webtoonImages/thumbnails/18_thumbnail_2.jpg', 'Florentia, imparatorluğun en zengin ailesinin gayri meşru çocuğu olarak yeniden doğdu. Gelecekte her şeyin iyi gideceğini düşünmüştü. Ama babası vefat etmiş, akrabaları onu kapı eşiğine bırakmış ve gurur duyduğu şerefli aile tamamen mahvolmuştur…. Ama bu gerçek mi? Biraz (çok) içti ve bir araba çarptı, Tekrar gözlerini açtığında yedi yaşında mıydı? Üstelik önceki hayatında ailesinin düşmanı olan İkinci Prens, onu bir köpek gibi takip ediyor! “Tia, sen benden daha güzelsin.” “… .Şu anda benimle dalga mı geçiyorsun?” “Hayır. İçtenlikle söyledim.” Pekala, hem İkinci Prens hem de aile benim! Bu hayatta, maderşahi olmam gerekecek. I’ll Be The Matriarch In This Life', 3, 1, 0, 13, 'Zamanda Yolculuk', '2023', 205, 2, 2, 4.00, 0, 0, 0, 0, 0, '2024-02-25 23:44:30', '2024-04-20 20:22:39'),
(22, 22, 'Why I Quit Being the Demon King', 'why-i-quit-being-the-demon-king', 'files/webtoons/webtoonImages/19.png', 'files/webtoons/webtoonImages/thumbnails/19_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/19_thumbnail_2.png', '-Şeytan Kral Olmayı Bırakma Sebebim-   Kaos zamanlarında şeytan kralı insanlar alemini işgal etmeden önce 665 alemi geçti. savaşı sonlandıran cesur bir kahraman vardı. Kutsal fedakarlıklar sayesinde insan ırkı hayatta kalmayı başardı ama bu yeni bir şeytan kralının hikayesinin başlamasına neden oldu. Şeytan kralı, 666. Demiourgos ile tanışın! Şeytanlar aleminden gitmeden önce “Şeytan kralı olmayı bırakıyorum´´ dedi. Bu şeytanlar aleminden kaçan kralın hikayesi. Şeytan kralı neden kral olmayı bıraktı?', 1, 1, 0, 2, 'Bilim Kurgu', '2024', 214, 0, 1, 5.00, 0, 0, 0, 0, 0, '2024-02-25 23:45:15', '2024-04-21 14:23:55'),
(24, 23, 'The Moonlight Shines On My Fading Future', 'the-moonlight-shines-on-my-fading-future', 'files/webtoons/webtoonImages/23.png', 'files/webtoons/webtoonImages/thumbnails/23_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/23_thumbnail_2.png', 'Bir vikontun kızı olan Lunatia, ailesi tarafından \"basireti\" için sömürülen bir araçtan başka bir şey değildi. Kendi nişanlısı tarafından bile kullanılan Lunatia, sonunda yeteneklerinin bedelini bir gözünü kaybederek öder. Kendisini bekleyen tek gelecek, beş duyusunun da kaybolduğu bir gelecektir... Kendi şartlarına göre yaşamaya ve onurlu bir ölümle ölmeye kararlı olan Lunatia evden kaçar. Yeni bir gelin aradığı söylenen \"Ay Tutulması Markisi \"nin malikânesine sığınır. Cesur bir kararlılıkla, bu korkunç ve görünüşte insanlık dışı adama evlenme teklif eder: \"Eğer beni gelinin yaparsan, günde bir kez geleceğini okuyacağım. Beni sevmek zorunda değilsin. Ve artık bana ihtiyacın kalmadığında, lütfen beni kendi ellerinle öldür.\" Böylece bu alışılmadık şartlara dayalı evlilikleri başlar. Lunatia ölümcül hislerini bir sır olarak saklamaya çalışsa da gerçekler ortaya çıkmaya başlar. Peki ama sözde taş kalpli kocası neden birdenbire beklenmedik derinlikte bir bağlılık göstermeye başlamıştır...?', 1, 1, 0, 6, 'Romantizm', '2024', 82, 0, 1, 3.50, 0, 0, 1, 1, 0, '2024-03-09 07:27:20', '2024-04-20 20:22:39'),
(25, 24, 'Leveling Up My Isekai’d Abs', 'leveling-up-my-isekai-d-abs', 'files/webtoons/webtoonImages/24.png', 'files/webtoons/webtoonImages/thumbnails/24_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/24_thumbnail_2.png', 'Sung Suwoo her şeye sahip - yakışıklı, güçlü ve popüler. Tek sorunu, ne kadar antrenman yaparsa yapsın karın kaslarını geliştirememesi! Sarkık bir karnı olduğu için kız arkadaşı tarafından terk edildikten sonra, bir webcomic evreninde tekrar doğar! Eve dönmek için tek bileti S-rank karın kaslarına sahip romantik türün en ateşli erkek karakteri olmaksa, başarılı bir şekilde geri dönebilecek mi?', 2, 1, 0, 2, 'Bilim Kurgu', '2024', 138, 3, 1, 3.00, 0, 0, 1, NULL, 0, '2024-03-09 09:20:58', '2024-04-20 20:22:39'),
(26, 25, 'Don’t Be Carelessly Friendly', 'don-t-be-carelessly-friendly', 'files/webtoons/webtoonImages/25.png', 'files/webtoons/webtoonImages/thumbnails/25_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/25_thumbnail_2.png', 'Yüzyıllar boyunca Caleta İmparatorluğu\'nun dahi şövalyesi olarak ünlenen, \'Bariyer\' ve bitmek bilmeyen savaşlarla mücadele eden \'Lustica Zenas\', sanki bir yalanmış gibi tüm gücünün bir gecede yok olduğunu gördü.\r\n\r\nDört yıllık inzivanın ardından, tatlı bir gece geçirdiği \'Hayden\' adında gizemli bir adam karşısına çıkar, ancak gerçek kimliği bilinmemektedir. Hayden, Lustica\'nın geçmişini hatırlıyor gibidir.\r\n\r\nBu arada Caleta İmparatoru, artık bir fakir gibi yaşayan Lustica\'yı çağırır ve onu diplomat olarak yıkılmakta olan bariyerin ötesindeki ezeli düşmanı Perseta İmparatorluğu\'na gönderir.\r\n\r\nTüm gücünü kaybetmiş olan eski şövalye Lustica, geçmişteki benliğini geri kazanabilecek midir?', 1, 1, 0, 6, 'Romantizm', '2024', 80, 1, 1, 5.00, 0, 0, 1, NULL, 0, '2024-03-14 12:24:38', '2024-04-20 20:22:38'),
(27, 26, 'Hand Over The Money!', 'hand-over-the-money-', 'files/webtoons/webtoonImages/26.png', 'files/webtoons/webtoonImages/thumbnails/26_thumbnail.png', 'files/webtoons/webtoonImages/thumbnails/26_thumbnail_2.png', 'Hand Over The Money\r\nÖzel kuvvetlerden zorla atıldıktan sonra normal bir ofis çalışanı hayatı yaşayan Ju Hyuk, bir gün gözlükleri aracılığıyla ani ve garip görevler alır.\r\nEn iyisini umarak görevleri yerine getirirken… Parası deli gibi çoğalmaya başlar…?!!!\r\nParanın tadını aldıktan sonra, Ju Hyuk ciddi bir şekilde para kazanmak için hayatta kalma oyunlarına katılmaya başlar ve ezici fiziği sayesinde diğer tüm katılımcıları ezip geçen bir müdavim haline gelir!!!', 1, 1, 0, 12, 'Sistem', '2024', 88, 3, 2, 2.25, 0, 0, 1, NULL, 0, '2024-03-17 12:21:25', '2024-04-20 20:22:38');
